import { Carousel } from 'bootstrap';
import React from 'react';
import coffeeCupLand from '../images/coffeeCupLand.jpg';
import coffeeCupWhite from '../images/coffeeCupWhite.jpg';
import coffeeExpress from '../images/coffeeExpress.jpg';
import coffeeFirst from '../images/coffeeFirst.jpg';

export default function Galeries() {
  return (
    <div className="galery-container">
      <Carousel>
        <Carousel.Item>
          <img className="d-block w-100" src={coffeeFirst} alt="First Slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={coffeeCupLand} alt="Second Slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={coffeeCupWhite} alt="Third Slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={coffeeExpress} alt="Fourth Slide" />
        </Carousel.Item>
      </Carousel>
    </div>
  );
}
